$contents = array(
  array('id' => '1','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1291001834275176" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm" style="text-decoration: underline;">BritzoneTuesdayClass</span></span></a> Proudly Presents: <br/>&#34;<b>Paralinguistic</b>&#34; by Rocky Michael Tandi</p><p style="font-size: 14px;">Have you ever heard of Paralinguistic before?<br/>Is it some kind of an expression or words or is it how you make people understand what you say? Body language, gestures, facial expressions, tone and pitch are all examples of paralinguistic features.</p><div class="text_exposed_show" style="font-size: 14px;"><p>The research of Astrid Acosta (2014) shows that the paralinguistic features proved to be helpful and <br/>relevant to be considered when learning English. Paralinguistic features alert the listener as to how to interpret the message.</p><p>Now the question is how it affects your English learning? For those of you who already knew, do you want to share your thoughts about paralinguistic?</p><p>We, Tuesdayâ€™s class PIC would like to bring you a class activity that may improve your English Speaking skill conducted by Rocky Michael Tandi.</p><p>So please mark it in your calendar and save the date. Our Tuesday class will be held on November 29, 2016 and start at 18.30 until 20.00. Come join us at <a href="http://l.facebook.com/l.php?u=http%3A%2F%2FDetik.com%2F&amp;h=aAQER7_ZJAQFtUdPb9v1ffuAEt8Ukrg9P8lAQjQsVV0aFTw&amp;enc=AZOi9KavclrpNhQLaP4ngdRPAlFO0XVyuoMmnAxI63nMUBJuv32mJ7sfWcpNt0cElBlhToc3vM_cEIVJQjssmKQ7_MiT2VhxyOzdWSbMkadD7pBDsQgdAoVg2Tpndys6kz3iATbJsn4bh1Z_Penfi8RccfqPPHWr8xgVsiSRcfOulvByJ87q9AqTZPmCpKCEPK9RtLWD--FVcUwB89Sn4rLh&amp;s=1" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">Detik.com</a> Redaction Office, on the 5th floor of Aldevco Building, Jl. Warung Buncit Raya No. 75 (Right in front of Buncit Indah Transjakarta\'s shelter), South Jakarta on.</p><p>Location link :</p><p><a href="http://maps.google.com/?cid=16438735132135200288&amp;hl=en&amp;gl=gb" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">http://maps.google.com/?cid=16438735132135200288&amp;hl=en&amp;gl=gb</a></p><p>Note : Due to security reason, please bring along your ID card or a copy.</p><p>- Britzone is supported by <a href="http://detik.com/" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">Detik.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1291001834275176" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzoneid</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1291001834275176" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1291001834275176" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1291001834275176" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a><br/>#<a href="http://l.facebook.com/l.php?u=http%3A%2F%2FDetik.com%2F&amp;h=oAQEWxh8cAQHFNAmdMqyDoG3126PScEv14YUXwsVIqLs50A&amp;enc=AZMDvQpPGyyBCzhAPQp_VlCBWOZo39Uh3Dk9X4jL_gXgLJFdn6s2LDcMs7JNN_Z3P09wX3UBcsiuDKayjUmo4NFUSY7ABHIw_z3GNtnjr2n1F9RmBKe9NnPp-9R4Fgaw2iFJAerNY0oJ1s7-y7xqfKBBZ0NNM2_p-ozHyhT8ENa